s.aN(0,"Multiple worlds",new A.b6c(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/multiple_worlds_example.dart","    This example shows how multiple worlds can have discrete collision\n    detection.\n    \n    The top two Embers live in one world and turn green when they collide and\n    the bottom two embers live in another world and turn red when they collide,\n    you can see that when one of the top ones collide with one of the bottom\n    ones, neither change their colors since they are in different worlds.\n  ")
s.aN(0,"QuadTree collision",new A.b6d(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/quadtree_example.dart",'In this example the standard "Sweep and Prune" algorithm is replaced by  \n"Quad Tree". Quad Tree is often a more efficient approach of handling collisions,\nits efficiency is shown especially on huge maps with big amounts of collidable \ncomponents.\nSome bricks are highlighted when placed on an edge of a quadrant. It is\nimportant to understand that handling hitboxes on edges requires more\nresources.\nBlue lines visualize the quad tree\'s quadrant positions.\n\nUse WASD to move the player and use the mouse scroll to change zoom.\nHold direction button and press space to fire a bullet. \nNotice that bullet will fly above water but collides with bricks.\n\nAlso notice that creating a lot of bullets at once leads to generating new\nquadrants on the map since it becomes more than 25 objects in one quadrant.\n\nPress O button to rescan the tree and optimize it, removing unused quadrants.\n\nPress T button to toggle player to collide with other objects.\n  ')
s.aN(0,"Raycasting (light)",new A.b6e(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_light_example.dart","In this example the raycast functionality is showcased by using it as a light\nsource, if you move the mouse around the canvas the rays will be cast from its\nlocation. You can also tap to create a permanent source of rays that wont move\nwith with mouse.\n  ")
s.aN(0,"Raycasting",new A.b6f(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_example.dart","In this example the raycast functionality is showcased. The circle moves around\nand casts 10 rays and checks how far the nearest hitboxes are and naively moves\naround trying not to hit them.\n  ")
s.aN(0,"Raytracing",new A.b6g(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raytrace_example.dart","In this example the raytrace functionality is showcased.\nClick to start sending out a ray which will bounce around to visualize how it\nworks. If you move the mouse around the canvas, rays and their reflections will\nbe moved rendered and if you click again some more objects that the rays can\nbounce on will appear.\n  ")
